import React from "react";
import mainLogo from'../../assets/github-logo.png'

const Signin: React.FC = () => {
  return (
    <div>
      <div>
        <form>
            <img  src={mainLogo} style={nbStyle.logo} alt="fireSpot"/>
        </form>
      </div>
    </div>
  );
};

export default Signin;
